    render() {
        console.log(this);
        return (
            <div>React App</div>
        )
    }
}
const mapStateToProps = state => {
    console.log('state', state);

    return { gamestarted: state.gamestarted };
}

const componentConnector = connect(mapStateToProps);
export default componentConnector(App);
